import React from 'react';
import './css/UI.css';

function Display(){
    return(
      <div className="Display Card">
      <nav> <a href="/"><i style={{color:"black",backgroundColor:"white"}} className="fa fa-file-text" ></i></a> | <a href="/tasks">tasks</a> </nav>
      </div>
  );
}
export default Display;
